const BuoyData = () => {

  // Replace with the URL of the HTML page you want to load
  const url = 'https://www.ndbc.noaa.gov/widgets/station_page.php?station=46224';
  // Fetch the HTML content using AJAX
  console.log('Extracted information:', url);
  fetch(url)
    .then(response => response.text())  // Get the response as text
    .then(html => {
      // Create a temporary div element to hold the HTML content
      const tempDiv = document.createElement('div');
      tempDiv.innerHTML = html;

      // Use DOM manipulation to extract specific information
      const specificInfo = tempDiv.querySelector('.class-name').textContent;
      console.log('Extracted information:', specificInfo);

      // Clean up: Remove the temporary div
      //tempDiv.remove();
      return tempDiv;
    })
    .catch(error => console.error('Error fetching the HTML:', error));
}

export default BuoyData;
